const changelog = [{
  "version": "2.28.1",
  "date": "2022-01-14",
  "bugfix": ['<p>Fixed a bug where the <code>disabledDate</code> of the <code>DatePicker</code> component was inaccurate in the parent panel.(<a href="https://github.com/arco-design/arco-design/pull/447">#447</a>)</p>\n']
}, {
  "version": "2.26.2",
  "date": "2021-12-10",
  "optimization": ['<p><code>DatePicker.RangePicker</code> component selected interactive optimization.(<a href="https://github.com/arco-design/arco-design/pull/312">#312</a>)</p>\n'],
  "bugfix": ['<p>Fix the bug that the <code>DatePicker</code> component does not trigger <code>onVisibleChange</code> in the controlled mode.(<a href="https://github.com/arco-design/arco-design/pull/314">#314</a>)</p>\n']
}, {
  "version": "2.25.1",
  "date": "2021-11-26",
  "optimization": ['<p>The <code>DatePicker.RangePicker</code> component <code>showTime.defaultValue</code> supports passing in <code>number[], string[], Date[]</code> to avoid errors caused by inconsistent dayjs instances.(<a href="https://github.com/arco-design/arco-design/pull/226">#226</a>)</p>\n']
}, {
  "version": "2.24.0",
  "date": "2021-11-05",
  "optimization": ['<p>If the value of the <code>DatePicker</code> component is <code>string</code> and it&#39;s dayjs value parsed as Invalid Date, will fallback format to &quot;YYYY-MM-DD&quot;(<a href="https://github.com/arco-design/arco-design/pull/113">#113</a>)</p>\n']
}, {
  "version": "2.23.1",
  "date": "2021-10-15",
  "bugfix": ["<p>Fix the bug that the <code>DatePicker</code> component <code>disabledDate</code> does not take effect in the shortcut panel.</p>\n"]
}, {
  "version": "2.23.0",
  "date": "2021-09-27",
  "feature": ["<p><code>DatePicker.RangePicker</code> add property <code>clearRangeOnReselect</code>.</p>\n", "<p>The <code>DatePicker.RangePicker</code> component <code>onSelect</code> adds a third parameter <code>extra</code>.</p>\n"],
  "bugfix": ["<p>Fix the bug that the panel is not updated in the first time when the <code>DatePicker.RangePicker</code> component updates mode.</p>\n", "<p>Fix the bug that <code>DatePicker.WeekPicker</code> does not initialize the local timezone and the start of the week.</p>\n"]
}, {
  "version": "2.22.0",
  "date": "2021-09-10",
  "bugfix": ["<p>Fix the bug that hover will report an error when the dayjs object passed in when using shortcuts in the <code>DatePicker</code> component is inconsistent with the internal version.</p>\n", "<p>Fix the bug that events on the outer dom cannot be triggered when the <code>DatePicker</code> component uses <code>dateRender</code>.</p>\n", "<p>Fix the bug that when the <code>DatePicker.RangePicker</code> component only uses the panel and has a default value, the first click to select requires one more point.</p>\n"],
  "typescript": ["<p><code>DatePicker.RangePicker</code> component <code>onOk</code> type correction.</p>\n"]
}, {
  "version": "2.21.1",
  "date": "2021-08-27",
  "bugfix": ["<p>Fix bug that asynchronous setting of <code>value</code> does not take effect when the <code>DatePicker</code> component has a value.</p>\n"]
}, {
  "version": "2.21.0",
  "date": "2021-08-20",
  "feature": ["<p><code>DatePicker</code> new interaction, add the highlight display of the next range, and put the operation of switching to time panel on the button</p>\n"],
  "bugfix": ["<p>Fix the bug that the week number of the <code>WeekPicker</code> component is not displayed correctly.</p>\n"],
  "typescript": ["<p>Correction of <code>pickerValue</code> type of <code>DatePicker.RangePicker</code>.</p>\n"]
}, {
  "version": "2.20.1",
  "date": "2021-08-06",
  "style": ["<p>Fix the issue that the style of the <code>DatePicker</code> component today will also appear on the gray date.</p>\n"]
}, {
  "version": "2.20.0",
  "date": "2021-07-30",
  "feature": ["<p>The <code>icons</code> parameter is added to the <code>DatePicker</code> component to support custom icons.</p>\n", "<p>The <code>DatePicker</code> component adds the <code>hideNotInViewDates</code> property to hide the gray date.</p>\n", "<p>The <code>dayStartOfWeek</code> property of the <code>DatePicker</code> component supports setting from Monday to Sunday.</p>\n"]
}, {
  "version": "2.19.3",
  "date": "2021-07-23",
  "bugfix": ["<p>Fix the bug that the input of the <code>DatePicker.RangePicker</code> component has a problem after setting <code>showTime</code>.</p>\n"]
}, {
  "version": "2.17.1",
  "date": "2021-06-20",
  "bugfix": ["<p>Fix the bug that the <code>DatePicker</code> component may report an error when judging the date change.</p>\n"]
}, {
  "version": "2.17.0",
  "date": "2021-06-18",
  "optimization": ["<p><code>DatePicker</code> group price interaction optimization, and fix the problem that when reselecting time in <code>showTime</code>, the selected value will be overwritten with the default value.</p>\n"]
}, {
  "version": "2.16.1",
  "date": "2021-06-04",
  "optimization": ["<p>Optimize the problem of repeated selection of the date in the <code>DatePicker.RangePicker</code> component.</p>\n"],
  "bugfix": ["<p>Fix the bug that when the <code>DatePicker</code> component <code>showTime</code>, select a value and hover the shortcut selection and then leave, the value will be restored to the initial value.</p>\n"]
}, {
  "version": "2.16.0",
  "date": "2021-05-28",
  "optimization": ["<p>Support fast time jump, click on the panel header to select the year and month arbitrarily.</p>\n", "<p>The date picker with time interactively returns to 1.0, and at the same time optimizes the disabled logic and performance.</p>\n", "<p>After the range selector disables a single time, the date selection and time selection of the corresponding panel will be automatically disabled on the panel.</p>\n", "<p>The left and right panels of the range selector are linked to avoid unexpected panel display.</p>\n"]
}, {
  "version": "2.15.3",
  "date": "2021-05-21",
  "bugfix": ["<p>Fix the bug that the time is incorrect after clicking the button at the moment after opening <code>showTime</code> in <code>DatePicker</code>.</p>\n"]
}, {
  "version": "2.15.0",
  "date": "2021-04-30",
  "bugfix": ["<p>Fix the bug that the <code>onSelect</code> callback of the <code>DatePicker</code> component is sorted before the selection is complete.</p>\n", "<p>Fixed the bug that when <code>DatePicker.RangePicker</code> was disabled halfway, clicking the confirm button still needed to choose another time.</p>\n"],
  "style": ["<p>Fixed the problem that when <code>DatePicker</code> and <code>TimePicker</code> components are disabled and have default values, the default values \u200B\u200Bare not displayed in Safari browser.</p>\n"]
}, {
  "version": "2.14.1",
  "date": "2021-04-16",
  "bugfix": ["<p>Fix the bug that the display is incorrect when the component switches the panel after entering the value after opening the <code>showTime</code> of the <code>DatePicker.RangePicker</code> component.</p>\n"]
}, {
  "version": "2.10.0 \u{1F3EE}",
  "date": "2020-02-26",
  "typescript": ["<p><code>DatePicker.WeekPicker</code> adds <code>dayStartOfWeek</code> type.</p>\n"]
}, {
  "version": "2.9.1",
  "date": "2021-02-20",
  "style": ["<p>Fix the problem that the background color of the error state of the <code>DatePicker</code> and <code>Select</code> components is incorrect in dark mode.</p>\n"]
}, {
  "version": "2.9.0 \u{1F525}",
  "date": "2021-02-05",
  "feature": ["<p><code>DatePicker</code> component supports setting <code>triggerElement</code> custom trigger element.</p>\n", "<p>When the <code>DatePicker</code> component sets <code>triggerElement=null</code>, it will directly display the panel.</p>\n"],
  "bugfix": ["<p>Fix the bug that the <code>DatePicker.RangePicker</code> component cannot be confirmed directly on the same day.</p>\n"]
}, {
  "version": "2.8.0",
  "date": "2021-01-22",
  "feature": ["<p>The <code>format</code> parameter of the <code>DatePicker</code> component supports incoming functions to customize the display content.</p>\n"],
  "bugfix": ["<p>Fix the bug that <code>onChange</code> does not trigger occasionally when clicking the today button in the controlled mode of the <code>DatePicker</code> component.</p>\n"]
}];
